import React, { Component } from 'react';

class Portfolio extends Component {

  componentWillMount = () => {
    console.log('hello from portfolio');
    fetch('/portfolio')
    .then(res=> res.json())
    .then(data => console.log(data));
     
  }

  render() {
    return (
    <div id='portfolio'>
  </div>
    );
  }
}

export default Portfolio;
